import React, { Component } from 'react'
import Logo from './logoIcon/Logo'
import IconMenu from './logoIcon/IconMenu'
export default class logoIcon extends Component {
    render() {
        return (
            <div className="IconMenu flex-fill ">
                <IconMenu></IconMenu>
                <Logo></Logo>
            </div>
        )
    }
}
